B.MJ=new A.bX("\n\nInicialmente, os discos originais da obra foram escaneados utilizando um digitalizador de negativos. Esse processo permitiu a cria\xe7\xe3o de imagens em alta defini\xe7\xe3o contendo todos os desenhos presentes nos discos da obra.",null,B.J,B.R)
