B.MZ=new A.bX("\n\nA obra \u201cPequena M\xe1quina de Associa\xe7\xf5es Po\xe9ticas\u201d (1967) possu\xeda o formato de um aparelho televisor com dois bot\xf5es girat\xf3rios frontais que permitiam a movimenta\xe7\xe3o de dois discos de vidro com pequenos desenhos que se sobrepunham. Com a luz de uma l\xe2mpada, a sobreposi\xe7\xe3o era projetada na tela do \u201ctelevisor\u201d criando as chamadas associa\xe7\xf5es po\xe9ticas.",null,B.J,B.R)
B.MH=new A.bX("\n\nEntre os desenhos dos discos haviam muitas imagens caracter\xedsticas das obras de Lenio, algumas delas dialogando com o per\xedodo de ditadura vigente na d\xe9cada de 1960. Por exemplo, atrav\xe9s da manipula\xe7\xe3o dos discos era poss\xedvel combinar uma grade de cela com um policial ou a bandeira do Brasil com uma arma.",null,B.J,B.R)
B.MP=new A.bX("\n\nLenio j\xe1 havia explorado a cria\xe7\xe3o de obras interativas na I Bienal Nacional de Artes Pl\xe1sticas (Salvador, 1966) onde apresentou a obra \u201cPede-se Tocar\u201d que constava da parte interna de um piano onde havia um trabalho de colagem e uma placa com o t\xedtulo da obra.",null,B.J,B.R)
B.MQ=new A.bX("\n\nA \u201cPequena M\xe1quina de Associa\xe7\xf5es Po\xe9ticas\u201d foi criada para a 9\xaa Bienal de S\xe3o Paulo (1967) e esteve exposta ao lado de outras duas obras: \u201cA Curra\u201d e \u201cN\xf3s, Artistas\u201d. Com o passar do tempo, a obra foi se deteriorando e hoje restam apenas os discos de vidro de onde foram retiradas e recuperadas as imagens para este projeto.  ",null,B.J,B.R)
B.MO=new A.bX("\n\nCuriosamente, \xe9 poss\xedvel ver a obra sendo manipulada em um trecho de um filme rodado na \xe9poca da Bienal intitulado \u201cUm homem e sua jaula\u201d de Fernando Coni Campos e Paulo Gil Soares. ",null,B.J,B.R)
