B.MT=new A.bX("\n\nLenio Braga nasceu em Ribeir\xe3o Claro, norte do Paran\xe1, em 5 de junho de 1931. ",null,B.J,B.R)
B.MS=new A.bX("\n\nDesde cedo manifestou inclina\xe7\xe3o para as artes pl\xe1sticas, demonstrando grande habilidade e uma curiosidade inesgot\xe1vel, que o acompanhou por toda a vida. Experimentou praticamente todas as formas de express\xe3o pl\xe1stica: desenho, pintura, gravura, escultura, muralismo, cer\xe2mica, artes gr\xe1ficas e fotografia. ",null,B.J,B.R)
B.MI=new A.bX("\n\nResidindo em S\xe3o Paulo desde os nove anos, Lenio acompanhou de perto o debate est\xe9tico e ideol\xf3gico que envolveu os artistas da d\xe9cada de 40.",null,B.J,B.R)
B.MV=new A.bX("\n\nTeve aulas de gravura com L\xedvio Abramo e Helen Kerr, mas foi autodidata em outras t\xe9cnicas. Estudou Hist\xf3ria da Arte e debru\xe7ou-se sobre os cl\xe1ssicos, estudando composi\xe7\xe3o, volume e t\xe9cnicas de claro-escuro. Apaixonou-se pelos impressionistas, optando definitivamente pelo figurativismo como forma de express\xe3o. Pesquisou atentamente o Modernismo brasileiro, preparando o terreno para sua ativa participa\xe7\xe3o nos anos 60.",null,B.J,B.R)
B.MM=new A.bX("\n\nNa d\xe9cada de 1950, mudou-se para Salvador, BA, onde participou de todo o movimento alimentado pela cria\xe7\xe3o dos cursos de artes da UFBA. Ao lado de artistas como M\xe1rio Cravo, Caryb\xe9, Genaro de Carvalho, Jenner Augusto, Agnaldo dos Santos, Carlos Bastos, Jos\xe9 de Dome, Hansen Bahia, Rubem Valentim, Mirabeau Sampaio, Raimundo de Oliveira, Ubirajara e outros, participou de diversas exposi\xe7\xf5es culminando com pr\xeamio de pintura obtido na I Bienal da Bahia (1966).",null,B.J,B.R)
B.MW=new A.bX("\n\nNo final da d\xe9cada de 1960, mudou-se para o Rio de Janeiro, vindo a falecer em fevereiro de 1973.",null,B.J,B.R)
